    [],nt"revision_timestamp": "2016-06-14T21:10:58.126517",nt"name": "barograms",nt"isopen":
    false,nt"url": null,nt"notes": "Barograms are weekly rectangular charts
    recording barometric pressure at a given station. The barograph is an instrument
    that makes a continuous pen and ink trace of the changing atmospheric pressure on
    a chart. The barograph chart is also called a barogram. There were also measurements
    made using other types of barometers, and recorded on paper forms. Pressures were
    in millibars or inches of mercury. Many of these barograms and forms were provided
    to the archive by U.S. agencies: National Weather Service (NWS), Federal Aviation
    Administration (FAA), U.S. Air Force Air Weather Service (AWS), and the U.S. Navy
    Weather Service. The archive includes barograms and forms from other sources, including
    merchant ships at sea.The archive has hundreds of thousands of barograms in physical
    media (primarily microfilm, though also includes microfiche and paper). The period
    of record begins in the late 19th century, spans the entire 20th century, and continues,
    though in smaller volume, into the present. A limited selection of scanned barograms
    are available digitally as well.",nt"license_title": null,nt"extras": [{ntt"key":
